import React from 'react'

function SubjectCard({subject, courses}) {

    const name = courses.map(course => {
        return course.name
    })
    const handleClick = (subject) => {

        <h2>{subject.courses}</h2>
    }

    return (

        <div onClick={()=>handleClick(subject)} >
            <h2>{subject.name}</h2>
        </div>

    )
}

export default SubjectCard
